id:
Optionally provide service-specific configuration parameters in a valid JSON object in-line.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Optionally provide a file containing service-specific configuration parameters in a valid JSON object. 
The path to the parameters file can be an absolute or relative path to a file.
CF_NAME update-service -c PATH_TO_FILE

Example of valid JSON object:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

translation:
Opcionalmente, proporcione los parámetros de configuración específicos del servicio en un objeto JSON válido en línea.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Opcionalmente, proporcione un archivo que contenga parámetros de configuración específicos del servicio en un objeto JSON válido. 
La vía de acceso al archivo de parámetros puede ser una vía de acceso absoluta o relativa a un archivo.
CF_NAME update-service -c PATH_TO_FILE

Ejemplo de objeto JSON válido:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

